        return <div className='location-page'>
                   <div className='bar'><Link to='/'>返回</Link><span>location</span><Link to='/search'>添加</Link></div>
                   <ol>
                       <li><div>新绛</div><div>Delete</div></li>
                   </ol>
               </div>
    }
}

export default Location
